var app = angular.module('sfbook',[ 'ngResource','ngRoute','LocalStorageModule','naif.base64']);

app.constant('baseServiceUrl', 'http://softuni-social-network.azurewebsites.net/api/');
app.constant('defaultCoverPicture', 'data:image/jpg;base64,')
app.constant('defaultProfilePicture', 'data:image/jpg;base64,');

app.config(['$routeProvider', function ($routeProvider,localStorageServiceProvider) {

    $routeProvider.when('/',{
        templateUrl: function(){
            if(!localStorage.userSession){
                return 'partials/login-register-form.html'
            }else{
                return 'partials/homepage.html'
            }
        }
    });

    //$routeProvider.when('/friends',{
    //    templateUrl: 'partials/friends-page.html',
    //    controller: 'HomePageCtrl'
    //});

    $routeProvider.when('/profile',{
        templateUrl: 'partials/profile.html',
        controller: 'HomePageCtrl',
        resolve:{
            isLogged: function($location){
                if(!localStorage.userSession){
                    console.log($localStorage.userSession);
                    $location.path('/');
                }
            }
        }
    });

    $routeProvider.when('/users/:username',{
        templateUrl: 'partials/current-friend-page.html',
        controller: 'HomePageCtrl',
        resolve:{
            isLogged: function($location){
                if(!localStorage.userSession){
                    $location.path('/');
                }
            }
        }
    });

    $routeProvider.when('/edit-profile',{
        templateUrl: 'partials/edit.html',
        controller: 'HomePageCtrl',
        resolve:{
            isLogged: function($location){
                if(!localStorage.userSession){
                    $location.path('/');
                }
            }
        }
});

    $routeProvider.when('/change-password',{
        templateUrl: 'partials/change-password.html',
        controller: 'HomePageCtrl',
        resolve:{
            isLogged: function($location){
                if(!localStorage.userSession){
                    $location.path('/');
                }
            }
        }
    });

    $routeProvider.otherwise({
        redirectTo: '/'
    });


}]);

